import React from 'react';
import NavBa from './NavBar';
import { Card, CardColumns, Container, Jumbotron, ListGroup, ListGroupItem } from 'react-bootstrap';

const Survey = (props) => {
    return (
        <Card>
            <Card.Body>
                <Card.Title><h3>{props.data.SName ? props.data.SName : "defName"}</h3></Card.Title>
                <Card.Subtitle className="mb-2 text-muted">Autor: {props.SAuthor ? props.SAuthor : "defAuth"}</Card.Subtitle>
                <Card.Text>
                    {props.SAbout ? props.SAbout : "defAbout"}
                </Card.Text>
            </Card.Body>
            <ListGroup className="list-group-flush">
                <ListGroupItem>Počet otázek: {props.QuestSum ? props.QuestSum : "0"}</ListGroupItem>
                <ListGroupItem><b>Doba:</b> {props.STime ? props.STime : "0 minut"}</ListGroupItem>
            </ListGroup>
            <Card.Body>
                <Card.Link href=""><b>Spustit</b></Card.Link>
                <Card.Link href="">Smazat</Card.Link>
            </Card.Body>
        </Card>
    )
}

const Podmenu = (props) => {
    const Result=[]
    for(const item in props.SurvData) {
        Result.push(<Survey data={item}></Survey>);
    }
    return (
        <CardColumns>{Result}</CardColumns>
    )
}

const SurvData = [
    {SName: "Dotazník k diplomové práci", SAuthor: "čet. Jitka Volná", SAbout: "Dotazník zaměřený pro studenty 1. a 2. ročníků UO na téma Alkohol a drogy. Data slouží k vypracování diplomové práci.", QuestSum: "15", STime: "10 minut"},
    {SName: "Školní dotazník", SAuthor: "Ing. Filip Hrubý", SAbout: "Tento dotazník slouží pro přezkoušení studentů z předmětu Projektový management", QuestSum: "15", STime: "10 minut"},
    {SName: "Dotazník Lorem ipsum", SAuthor: "generátor", SAbout: "Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Nulla non arcu lacinia neque faucibus fringilla. Etiam bibendum elit eget erat.", QuestSum: "35", STime: "20 minut"}];

const Album = () => (
    <Container className="p-1">
        <NavBa></NavBa>
        <Jumbotron>
            <h2>Prohlížení zveřejněných anket</h2><br></br>
            <p>Níže vyberte požadovanou anketu, kterou zahájíte příslušným tlačítkem</p>
        </Jumbotron>
        <Podmenu SurvData={SurvData}/>
    </Container>
);

export default Album;
